import React from 'react'
import '../../scss/components/Body.css'
import Sidebar from '../Sidebar'
import Contact from '../Contact'
const Body_contact = () => {
  return (
        <div id="body">
            <Sidebar />
            <Contact />
            </div>
  )
}

export default Body_contact
